import React from 'react'
import { useHistory } from 'react-router-dom'

class ActionButton extends React.Component {
   constructor(){
      super();
      let history = userHistory();
   }

   buttonAction(){
      // console.log('hello');
      // <Link to="/shop">
      // </Link>
      history.push("/shop");
   }

   render(){
      return (
         <Link to={this.props.url}>
            <button id={this.props.id}>
               {this.props.name}
            </button>
         </Link>
      )
   }
}

export default ActionButton
